import React, { Component } from 'react'
import "slick-carousel/slick/slick.css"; 
import "slick-carousel/slick/slick-theme.css";
import Slider from "react-slick";

const photos = [
    {
        name: 'Photo 1',
        url: "/images/sad.jpg"
    },
    {
        name: 'Photo 2',
        url: "/images/sad2.jpg"
    },
    {
        name: 'Photo 3',
        url: "/images/sad3.jpg"
    },
    {
        name: 'Photo 4',
        url: "/images/sad4.jpeg"
    }
]


class Landing extends Component {
  render() {
      const settings = {
          dots : true,
          fade : true,
          infinte : true,
          speed : 500,
          slidesToShow:1,
          arrows:true,
          slidesToScroll:1,
          className:"slides"
      };
    return (
        <div className="SimpleSlider">
                <Slider {...settings}>
                    {photos.map((photo) =>{
                        return(
                            <div>
                                <img width="100%" hei src={photo.url} className="clsImage" alt="Not Found"/>
                            </div>
                        )
                    })}
                </Slider>
                </div>      
    )
  }
}

export default Landing;
